ED_DecisionText:
At its 55th plenary meeting, on 17 December 2018, the General Assembly, on the recommendation of the Third Committee,  decided to take note of the following documents under the item entitled “Advancement of women”:
	(a) Report of the Committee on the Elimination of Discrimination against Women on its sixty-seventh, sixty-eighth and sixty-ninth sessions; 
	(b) Report of the Secretary-General on the intensification of efforts to eliminate all forms of violence against women and girls; 
	(c) Note by the Secretary-General transmitting the report of the Special Rapporteur on violence against women, its causes and consequences.
